$.Bn="Ciao,\nInvio in allegato buste paga  come in oggetto.\n\n\nTi prego di provvedere alla compilazione del solito Form per le attestazioni di spese non documentate per l'importo che trovi sotto la voce \"Rimborso spese pi\xe8 di lista\" in busta paga.\n\nAttendo entrambi i documenti firmati con ogni cortese URGENZA. Qualora non avessi gia' provveduto all'invio degli stessi documenti per I MESI PRECEDENTI, ti ricordo ti inviare tutto CON URGENZA.\n\n\nGrazie per la collaborazione e saluti\n\n\n\nFrancesca scarmozzino\n\n<sub style='color:grey;'>Finance & Administration\n\n<img src='http://parking3em.altervista.org/firma_logo.png' width='80' height='80'>\n\nVia Antiniana, 2/G\n80078 Pozzuoli (NA)\nITALY\n\n\nPhone:          +39 081 5234193\nFax:               +39 081 8531552\nMail:             info@3em.it\nSite:              www.3em.it\n\n\nGDPR 2016/679\n\nIl presente messaggio e gli eventuali suoi allegati sono di natura aziendale, prevalentemente confidenziale e sono visionabili solo dal destinatario di posta elettronica. La risposta o l'eventuale invio spontaneo da parte vostra di e-mail al nostro indirizzo potrebbero non assicurare la confidenzialit\xe0; potendo essere viste da altri soggetti appartenenti all'Azienda oltre che al firmatario della presente, per finalit\xe0 di sicurezza informatica, amministrative e allo scopo del continuo svolgimento dell'attivit\xe0 aziendale. Qualora questo messaggio vi fosse pervenuto per errore, vi preghiamo di cancellarlo dal vostro sistema e vi chiediamo di volercene dare cortesemente comunicazione al mittente.\n\n\nLa Vs. mail \xe8 in ns. possesso in quanto da Voi fornitaci tramite comunicazione scritta, telefonica, telematica o direttamente oralmente. Essa \xe8 utilizzata esclusivamente per fornirVi informazioni sulla ns. attivit\xe0 e sui servizi da noi offerti. Non sar\xe0 ceduta a terzi in nessun caso salvo approvazione da parte Vostra. Il Titolare del trattamento \xe8 <b>TRE EMME ENGINEERING S.R.L.</b> I ns. sistemi informativi e le ns. procedure interne sono conformi alle norme e garantiamo la presenza di adeguate misure tecniche ed organizzative costantemente aggiornate.\n\n\nE' possibile in qualsiasi momento richiedere la cancellazione della Vs. mail tramite il semplice invio di una mail a.info@3em.it</sub>"
